import React from "react";
const Header = () => {
  return (
    <div>
      <div className="App-logo">
        <div className="Content">
          <img
            src="/images/premium-logo-black@3x.png"
            alt="logo Prenium"
            style={{ width: "70%" }}
          />
        </div>
        <div className="Icons">
          <img src="/images/fr@2x.png" alt="Icon 4" />
          France
          <img src="/images/picto-utilisateur-connecte.png" alt="Icon 4" />
        </div>
      </div>
    </div>
  );
};
export default Header;
